def constraint_consistent(opset = 0, increment = .1):
    st = datetime.now()
    j = 0
    greedy_avg = []
    mcf_avg = []
    greedy_all = []
    mcf_all = []
    if opset == 0:
        settings = choose_settings()  # set the settings
    else:
        settings = opset
    constraint_max = settings[3][1]
    constraint_current = 1.5
    print(constraint_max)
    k = int(round((constraint_max - constraint_current) / increment) + 1)
    print(k)
    # f = open("currData.txt", "a+")
    print('Users:', settings[0], '| Constraint: 1.5 -', settings[3][1], '| Increment:', increment, '| Number of runs:',
          settings[1], '| Distribution:', settings[2], '\n', file=f)
    settings[3][1] = constraint_current
    index = np.array([0] * (k + 1)).astype(float)

    greedy_all = []
    mcf_all = []

    data = []
    for x in range(settings[1]):
        d = create_data(settings)
        i = Instance(d[0],d[1])
        data.append(i)
    # print(data)
    while j < k:
        greedytemp = 0
        mcftemp = 0
        instances = 0
        greedy_failures = np.array([0,0,0,0])
        mcf_failures = 0
        print('Constraint:', settings[3][1])
        print('\nConstraint:', settings[3][1], file=f)
        index[j] = float(settings[3][1])  # update index constraint

        for x in range(len(data)):  # run distribution on instances using constraint j

            greedy, instances = run_greedy2(settings, data[x])
            mcf = run_mcf(settings, data[x].stations, data[x].users)
            # print(greedy)
            # print(mcf)
            # add passing instances here and then average out, keep one for all instances, other for average
            if type(mcf) is not type(0):  # if mcf passed

                if type(mcftemp) is type(0):
                    mcftemp = np.array(mcf)
                    greedytemp = np.array(greedy)
                else:
                    mcftemp = np.add(mcftemp, mcf)
                    greedytemp = np.add(greedytemp, greedy)
                greedy_failures = np.add(greedy_failures, instances)
                print('Passed instance', x)
            else:
                print('MCF FAILED')



        greedytemp = greedytemp/len(data)  # get average of runs from instances and append
        mcftemp = (mcftemp/len(data)).tolist()  # get average of runs from instances and append


        # print(greedytemp)
        # print(mcftemp)
        # print('Greedy Failures:' + str((len(data) - len(greedytemp))), file=f)
        # print('MCF Failures:' + str((len(data) - len(mcftemp))), file=f)
        print('Greedy Failures:' + greedy_failures.tostring(), file=f)
        # print('MCF Failures:' + str(mcf_failures), file=f)
        greedy_all.append(greedytemp)
        mcf_all.append(mcftemp)
        settings[3][1] += increment  # increase constraint by increment
        settings[3][1] = round(settings[3][1], 1)

        j += 1

    # et = datetime.now()
    # print('Total Runtime:', et - st, file=f)
    # print('Total Runtime:', et - st)
    big_tolist(greedy_all)
    # print(greedy_all)
    # print(mcf_all)
    # clean(greedy_all)
    constraint_to_file(greedy_all, mcf_all)
